import React from 'react'
import LikeButton from '../like_button'
import styled from 'styled-components'


const ProfilePhoto = styled.div`
  img {
    height: 300px;
    border: 1px solid #efefef;
  }
`

const Post = (props) => {
  const { id, image_url } = props.attributes
  return (
    <div className="card">
    <ProfilePhoto>
      <img src={image_url} />
    </ProfilePhoto>

      <LikeButton />
    </div>
  )
}

export default Post
